import './media-button.css';
import React from 'react'
import { Link } from "react-router-dom";

export default function ProjectsButton() {

    return (
        <div class="media-button-parent">
        <Link to="/Media">
        <button className="media-button">Projects</button>
        </Link>
        </div>
    );
  }
